        private OneDbContext context = null;

        public MenuLinks(OneDbContext db)
        {
            this.context = db;
        }
        public void AddUpdateDefaultUserGroup()
        {
            context.UserGroups.AddOrUpdate(p => p.UserGroupName,
                  new UserGroup { UserGroupId = 1, UserGroupName = "Admin" },
                  new UserGroup { UserGroupId = 2, UserGroupName = "Accountant" },
                  new UserGroup { UserGroupId = 3, UserGroupName = "HR Manager" },
                  new UserGroup { UserGroupId = 4, UserGroupName = "Asset Manager" }
             //new UserGroup {UserGroupId = 5, UserGroupName = "Academics Manager" },
             //new UserGroup {UserGroupId = 2, UserGroupName = "Teacher" },
             );
        }

        public void ImportUserGroups(UserGroup[] userGroups)
        {
            context.UserGroups.AddOrUpdate(p => p.UserGroupId, userGroups);
        }

        public void AddUpdateAllFormMenus()
        {
            context.Forms.AddOrUpdate(p => p.FormID, GetFormList().ToArray());
        }

        public List<FormVM> GetParentForms()
        {
            return GetFormList()
                .Where(s => s.ParentForm == 1)
                .OrderBy(p => p.FormID)
                .Select(s => new FormVM
                {
                    FormId = s.FormID,
                    FormName = s.FormName ?? s.MenuText,
                }).ToList();
        }

        public List<Form> AddedForms { get; set; }

        public void AddSelectedFormChildren(long[] ids)
        {
            AddedForms = new List<Form>();
            AddChildren(GetFormList().Where(s => ids.Contains(s.FormID)).ToList());
            context.Forms.AddOrUpdate(p => p.FormID, AddedForms.ToArray());
        }

        public void AddChildren(List<Form> list)
        {
            foreach (var form in list)
            {
                AddedForms.Add(form);
                AddChildren(GetFormByCondition(s => s.ParentForm == form.FormID));
            }
            return;
        }

        public List<Form> GetFormByCondition(Expression<Func<Form, bool>> predicate)
        {
            return GetFormList().Where(predicate.Compile()).ToList();
        }

