        public void AddGroupRights(int userGroupId)
        {
            context.Database.ExecuteSqlCommand(@"
													update  membership.Forms set MenuText=FormName  where MenuText is null
													update  membership.Forms set IsMenuItem=0  where ParentForm not in (501001, 1) and IsMenuItem = 1"
       );

            context.Database.ExecuteSqlCommand($@"
DECLARE @TBL1 TABLE (FormID BIGINT, FormURL VARCHAR(100), FormName VARCHAR(50), ParentForm BIGINT, IsMenuItem BIT, MenuText VARCHAR(50), MenuItemPriority INT, isActive VARCHAR(5), ShowOnDesktop BIT, IsDashboardPart BIT, PageDescription VARCHAR(50));

INSERT INTO @TBL1
SELECT 1, '_PartialShowStats', 'Stats area', 1, 0, 'ShowStats', 1, 'Yes', 0, 1, 'col-lg-8'
--UNION
--select 1,'_PartialShowWeeklySale','WeeklySale graph',1,0,'ShowWeeklySale',1,'Yes',0,1,'col-lg-8'
--UNION
--select 1,'_PartialShowTransactions','Transactions grpah',1,0,'ShowTransactions',1,'Yes',0,1,'col-lg-8'

UNION

SELECT 1, '_PartialShowDashboardMenus', 'Dashboard Menus area', 1, 0, 'ShowDashboardMenus', 1, 'Yes', 0, 1, 'col-lg-8'
--UNION
--select 1,'_PartialShowIncomeExpense','Income Expense graph',1,0,'ShowIncomeExpense',1,'Yes',0,1,'col-lg-8'

UNION

SELECT 1, '_PartialShowQuickLinks', 'QuickLinks area', 1, 0, 'ShowQuickLinks', 0, 'Yes', 0, 1, 'col-lg-4'
--UNION
--select 1,'_PartialShowSomething','Something area',1,0,'ShowSomething',1,'Yes',0,1,'col-lg-4'

UNION

SELECT 1, '_PartialShowTopIcons', 'Top icons area', 1, 0, 'Top icons area', 1, 'Yes', 0, 1, ''
--UNION
--select 1,'_PartialEmployeeCheckins','Dashboard Menus area',1,0,'EmployeeCheckins',1,'Yes',0,1,'col-lg-4'

UNION

SELECT 1, '_PartialUpcomingEvents', 'Upcoming Events area', 1, 0, 'UpcomingEvents', 1, 'Yes', 0, 1, 'col-lg-4'

DECLARE @nextFormId BIGINT

SELECT @nextFormId = Max(FormID)
FROM Membership.Forms

INSERT INTO Membership.Forms (FormID, FormName, FormURL, ParentForm, IsMenuItem, MenuText, MenuItemPriority, isActive, ShowOnDesktop, ModuleId, IsDashboardPart, PageDescription, IsMasterMenu, IsGroupReportHead, IsAjaxRequest, IsHideChilds, IsAction)
SELECT @nextFormId + ROW_NUMBER() OVER (
		ORDER BY y.FormID
		) AS FormId, y.FormName, y.FormURL, y.FormID AS ParentForm, tb.IsMenuItem, tb.MenuText, tb.MenuItemPriority, tb.isActive, tb.ShowOnDesktop, 0, 1, tb.PageDescription, 0, 0, 0, 0, 0
FROM (
	SELECT dm.FormURL, m.FormID, dm.FormName
	FROM @TBL1 AS dm
	CROSS JOIN (
		SELECT FormID
		FROM Membership.Forms
		WHERE FormName = 'Dashboard'
		) M
	
	EXCEPT
	
	SELECT FormURL, ParentForm, FormName
	FROM [Membership].[Forms]
	) y
INNER JOIN @TBL1 AS tb ON tb.FormURL = y.FormURL

DECLARE @TBL TABLE ([Action] VARCHAR(50));

INSERT INTO @TBL ([Action])
SELECT 'Can Create'

UNION

SELECT 'Can Read'

UNION

SELECT 'Can Update'

UNION

SELECT 'Can Delete';

INSERT INTO [Membership].[FormRights] ([FormRightName], [FormId])
SELECT [t].[Action], [FormId]
FROM @TBL AS [t]
CROSS JOIN [Membership].[Forms]

EXCEPT

SELECT FormRightName, FormId
FROM Membership.FormRights;

INSERT INTO [Membership].[GroupRights] ([GroupId], [FormRightId], [Allowed])
--SELECT 1 AS [GroupId], [fr].[FormRightId], 1
SELECT 4 AS [GroupId], [fr].[FormRightId], 1
FROM [Membership].[FormRights] AS [fr]

EXCEPT

SELECT [GroupId], [FormRightId], 1
FROM [Membership].[GroupRights]
");
        }

